import React from 'react';
import Header from './Header';
const Login =(props)=>{
    const{
        email,
        setEmail,
        password,
        setPassword,
        handlelogin,
        handleSignup,
        hasAccount,
        setHasAccount,
        emailError,
        passwordError} = props;
    return(
        
        <section>
            
            <div className="imgBx">
                <img src="img/login.jpg"></img>
            </div>
            <div className="contentBox">
                <div className="formBx">
                    <h2>Login</h2>
                    
                </div>
            </div>
        </section>
    )
}
export default Login;
